script: |
  super -f text -I q2789.spq | sort > q2789.out

inputs:
  - name: q2789.spq
    data: |
      SELECT ALL + - col2 AS col1, col2 * + ( col0 ) + + - col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 60 + + - ( - + col2 ) = - 89 / + col2 * - col0;
  - name: tab1

outputs:
  - name: q2789.out
    data: |
      -59	4956
      -68	6120
      -96	4800
